INSERT INTO `courses` (`id`, `capacity`, `description`, `instructor`, `title`, `type`, `year`, `semester`, `code`) VALUES
(1, 5, 'This course introduces students to the fundamentals of programming using a modern language such as Python or Java. Topics include variables, data types, control structures, functions, arrays/lists, and basic debugging techniques. The course emphasizes pro', NULL, 'Introduction to Programming', NULL, '1st Year', 'A', 'CS101'),
(2, 5, 'This course covers essential data structures (arrays, stacks, queues, linked lists, trees, graphs) and algorithms (sorting, searching, recursion, dynamic programming). Students will analyze algorithm complexity and performance using Big O notation and imp', NULL, 'Data Structures and Algorithms', NULL, '1st Year', 'A', 'CS102'),
(3, 5, 'Explore the internal workings of modern computers, from binary logic to CPU design. Topics include number systems, digital circuits, instruction cycles, memory hierarchy, and input/output systems. This course helps bridge hardware and software understandi', NULL, 'Computer Architecture and Organization', NULL, '1st Year', 'A', 'CS103'),
(4, 5, 'This course introduces the concepts of object-oriented programming including classes, objects, inheritance, polymorphism, encapsulation, and abstraction using a language such as Java or C++. Students will develop modular and reusable applications.', NULL, 'Object-Oriented Programming (OOP)', NULL, '1st Year', 'A', 'CS203'),
(5, 5, 'This course dives into the design and implementation of modern operating systems. Topics include process management, memory allocation, file systems, device management, synchronization, and security. Students will understand how OS components interact wit', NULL, 'Operating Systems', NULL, '1st Year', 'B', 'CS201'),
(6, 5, 'Students will learn about relational database systems, SQL queries, normalization, indexing, transactions, and ER modeling. The course includes practical labs using MySQL or PostgreSQL to build and manage databases.', NULL, 'Database Systems', NULL, '1st Year', 'B', 'CS202'),
(7, 5, 'This course introduces full-stack web development using HTML, CSS, JavaScript, and a backend language (like PHP or Node.js). Topics include REST APIs, responsive design, user authentication, and deployment.', NULL, 'Web Development', NULL, '1st Year', 'B', 'CS301'),
(8, 5, 'Covers the software development life cycle, design patterns, version control (Git), testing, and agile methodologies. Students will work in teams to plan, design, develop, and document a software project.', NULL, 'Software Engineering', NULL, '1st Year', 'B', 'CS302'),
(9, 5, 'Covers the fundamentals of developing applications for mobile platforms (Android or iOS). Topics include UI design, navigation, data persistence, APIs, sensors, and publishing to app stores.', NULL, 'Mobile App Development', NULL, '1st Year', 'C', 'CS303'),
(10, 5, 'This course provides an introduction to computer security, covering topics such as encryption, authentication, firewalls, malware, ethical hacking, and best practices for securing networks and applications.', NULL, 'Cybersecurity Fundamentals', NULL, '1st Year', 'C', 'CS304'),
(11, 5, 'Introduces the study and design of user interfaces with a focus on usability, accessibility, user research, and interaction techniques. Students will prototype interfaces and conduct user testing.', NULL, 'Human-Computer Interaction (HCI)', NULL, '1st Year', 'C', 'CS305'),
(12, 5, 'Focuses on the techniques used to create and manipulate graphics using code. Topics include rendering, 2D/3D transformations, modeling, shaders, and OpenGL/WebGL programming.', NULL, 'Computer Graphics', NULL, '1st Year', 'C', 'CS306'),
(13, 5, 'This course explores network architectures, protocols (TCP/IP, HTTP, FTP), addressing, routing, and network security. Labs may include setting up virtual networks and capturing packets with tools like Wireshark.', NULL, 'Computer Networks', NULL, '2nd Year', 'A', 'CS401'),
(14, 5, 'An introduction to AI concepts including search algorithms, machine learning, neural networks, natural language processing, and robotics. Students will implement simple intelligent systems and learn ethical considerations in AI.', NULL, 'Artificial Intelligence (AI)', NULL, '2nd Year', 'A', 'CS402'),
(15, 5, 'Explore cloud computing concepts including virtualization, cloud services (IaaS, PaaS, SaaS), deployment models, and cloud platforms like AWS or Azure. The course includes hands-on experience with cloud-based hosting and storage.', NULL, 'Cloud Computing', NULL, '2nd Year', 'A', 'CS403'),
(16, 5, 'An in-depth introduction to supervised, unsupervised, and reinforcement learning. Students will use Python libraries such as Scikit-learn, Pandas, and TensorFlow to build predictive models from real datasets.', NULL, 'Machine Learning', NULL, '2nd Year', 'A', 'CS404'),
(17, 5, 'This practical course teaches how to ethically test and secure systems against hackers. Topics include vulnerability scanning, network penetration, password cracking, and legal considerations of ethical hacking.', NULL, 'Ethical Hacking and Penetration Testing', NULL, '2nd Year', 'B', 'CS405'),
(18, 5, 'Covers the principles and tools of DevOps, including CI/CD pipelines, version control, Docker, Kubernetes, Jenkins, and automated testing. Students will build modern deployment workflows.', NULL, 'DevOps and Continuous Integration', NULL, '2nd Year', 'B', 'CS406'),
(101, 5, 'This foundational course introduces the principles of electric circuits, including Ohm\'s Law, Kirchhoff\'s Laws, Thevenin and Norton theorems, and nodal/mesh analysis. Students learn to analyze and design basic DC and AC circuits using resistors, capacitor', NULL, 'Circuit Analysis', NULL, '1st Year', 'A', 'EE101'),
(102, 5, 'Covers the theory and applications of electric and magnetic fields. Topics include Coulomb\'s Law, Gauss\'s Law, Ampère’s Law, and Maxwell’s equations. Practical applications include wave propagation, antennas, and transmission lines.', NULL, 'Electromagnetics', NULL, '1st Year', 'A', 'EE102'),
(103, 5, 'Focuses on the design of digital systems using logic gates, flip-flops, multiplexers, decoders, and programmable logic devices. Students design and simulate combinational and sequential circuits.', NULL, 'Digital Logic Design', NULL, '1st Year', 'B', 'EE201'),
(104, 5, 'Explores semiconductor devices such as diodes, BJTs, and MOSFETs. Topics include amplifiers, biasing, feedback, and frequency response. Labs reinforce real-world circuit behavior and measurements.', NULL, 'Analog Electronics', NULL, '1st Year', 'B', 'EE202'),
(105, 5, 'Introduces signal representation in time and frequency domains. Covers convolution, Fourier transforms, Laplace transforms, and system analysis using transfer functions.', NULL, 'Signals and Systems', NULL, '1st Year', 'C', 'EE301'),
(106, 5, 'Teaches control theory including feedback, stability, time and frequency domain analysis, Bode plots, and PID controllers. Applications include automation and robotics.', NULL, 'Control Systems', NULL, '1st Year', 'C', 'EE302'),
(107, 5, 'Focuses on generation, transmission, and distribution of electric power. Topics include transformers, power flow analysis, fault analysis, and system protection.', NULL, 'Power Systems', NULL, '2nd Year', 'A', 'EE401'),
(108, 5, 'Covers microcontroller architecture (e.g., ARM or AVR), assembly language, interfacing with sensors, and real-time systems. Students build embedded systems using C and hardware kits (e.g., Arduino, STM32).', NULL, 'Microprocessors and Embedded Systems', NULL, '2nd Year', 'A', 'EE402'),
(109, 5, 'Explores solar, wind, hydro, and biomass energy generation. Covers system components, energy conversion, grid integration, and environmental impact.', NULL, 'Renewable Energy Systems', NULL, '2nd Year', 'B', 'EE403'),
(110, 5, 'Covers the theory and operation of electrical machines including transformers, synchronous machines, induction motors, and DC machines. Labs involve machine testing and performance evaluation.', NULL, 'Electrical Machines', NULL, '2nd Year', 'B', 'EE404'),
(111, 5, 'Focuses on the use of electronic devices in power conversion systems. Topics include rectifiers, inverters, choppers, and AC voltage controllers using SCRs, MOSFETs, and IGBTs.', NULL, 'Power Electronics', NULL, '2nd Year', 'C', 'EE405'),
(112, 5, 'Introduces the principles of measurement systems and instrumentation. Covers sensors, transducers, signal conditioning, and data acquisition.', NULL, 'Instrumentation and Measurement', NULL, '2nd Year', 'C', 'EE406'),
(113, 5, 'Teaches the planning and implementation of electrical wiring systems in residential and industrial buildings, including protection methods like circuit breakers, fuses, and grounding.', NULL, 'Electrical Installation and Protection', NULL, '3rd Year', 'A', 'EE407'),
(114, 5, 'Focuses on the generation, measurement, and testing of high voltages and currents. Topics include insulation coordination, breakdown mechanisms, and overvoltage protection.', NULL, 'High Voltage Engineering', NULL, '3rd Year', 'A', 'EE408'),
(115, 5, 'Explores how electrical energy is used in industrial and commercial applications. Topics include heating, lighting, traction, and energy efficiency.', NULL, 'Electrical Energy Utilization', NULL, '3rd Year', 'B', 'EE409'),
(116, 5, 'Introduces analog and digital communication techniques. Topics include AM/FM modulation, PCM, noise analysis, bandwidth, and transmission media.', NULL, 'Communication Systems', NULL, '3rd Year', 'B', 'EE410'),
(117, 5, 'Covers electronics and instrumentation used in healthcare, including ECG, EEG, pacemakers, and imaging technologies. Emphasizes safety and signal conditioning in biological systems.', NULL, 'Biomedical Instrumentation', NULL, '3rd Year', 'C', 'EE411'),
(118, 5, 'Focuses on automation technologies, robot kinematics, sensors, actuators, and control systems. Includes hands-on projects involving robotic arms and autonomous systems.', NULL, 'Robotics and Automation', NULL, '3rd Year', 'C', 'EE412'),
(201, 5, 'Introduces fundamental concepts of planning, organizing, leading, and controlling in business settings. Emphasizes managerial roles and decision-making processes.', NULL, 'Principles of Management', NULL, '1st Year', 'A', 'BA101'),
(202, 5, 'Covers the basics of financial statements, journal entries, ledgers, and accounting principles. Focuses on external reporting.', NULL, 'Financial Accounting', NULL, '1st Year', 'A', 'BA102'),
(203, 5, 'Explores the concepts of product, price, promotion, and place (4 Ps). Emphasizes market research and customer behavior.', NULL, 'Marketing Principles', NULL, '1st Year', 'A', 'BA103'),
(204, 5, 'Covers effective written, verbal, and non-verbal communication in professional environments. Includes business writing, reports, and presentations.', NULL, 'Business Communication', NULL, '1st Year', 'B', 'BA104'),
(205, 5, 'Focuses on consumer behavior, market demand/supply, pricing, and competition at the individual and firm level.', NULL, 'Microeconomics', NULL, '1st Year', 'B', 'BA105'),
(206, 5, 'Covers legal frameworks affecting business including contracts, torts, intellectual property, and employment law.', NULL, 'Business Law', NULL, '1st Year', 'B', 'BA106'),
(207, 5, 'Studies human behavior in organizations, including motivation, leadership, teamwork, and organizational culture.', NULL, 'Organizational Behavior', NULL, '1st Year', 'C', 'BA201'),
(208, 5, 'Examines national and global economies: GDP, inflation, unemployment, fiscal and monetary policy.', NULL, 'Macroeconomics', NULL, '1st Year', 'C', 'BA202'),
(209, 5, 'Covers recruitment, performance management, training, compensation, and labor relations.', NULL, 'Human Resource Management', NULL, '2nd Year', 'A', 'BA203'),
(210, 5, 'Focuses on costing systems, budgeting, and variance analysis to assist in managerial decision-making.', NULL, 'Cost Accounting', NULL, '2nd Year', 'A', 'BA204'),
(211, 5, 'Explores production planning, quality control, supply chain management, and process optimization.', NULL, 'Operations Management', NULL, '2nd Year', 'B', 'BA205'),
(212, 5, 'Discusses ethical dilemmas in business and the importance of CSR and sustainability.', NULL, 'Business Ethics and Corporate Social Responsibility', NULL, '2nd Year', 'B', 'BA206'),
(213, 5, 'Focuses on financial planning, capital structure, valuation, and investment analysis.', NULL, 'Financial Management', NULL, '2nd Year', 'C', 'BA301'),
(214, 5, 'Teaches how to develop and implement long-term strategies for competitive advantage.', NULL, 'Strategic Management', NULL, '2nd Year', 'C', 'BA302'),
(215, 5, 'Encourages creative thinking, opportunity recognition, business planning, and startup funding.', NULL, 'Entrepreneurship and Innovation', NULL, '3rd Year', 'A', 'BA303'),
(216, 5, 'Examines global trade, international markets, cultural dynamics, and global strategy.', NULL, 'International Business', NULL, '3rd Year', 'A', 'BA304'),
(217, 5, 'Explores how businesses use technology for decision-making, operations, and customer management.', NULL, 'Management Information Systems', NULL, '3rd Year', 'B', 'BA305'),
(218, 5, 'Covers project planning, scheduling, budgeting, and execution using PMI standards.', NULL, 'Project Management', NULL, '3rd Year', 'B', 'BA306'),
